mapper.update:
update physical_examination_record
set archive_no = #{archiveNo,jdbcType=VARCHAR}
where archive_no = #{oldArchiveNo,jdbcType=VARCHAR}

mapper.select:
	SELECT COUNT(*) examTotalNum FROM physical_examination_record 
	where 1 = 1
	
		and create_org = #{createOrg,jdbcType=VARCHAR}
	
	
            and DATE_FORMAT(check_date, '%Y-%m-%d') >= #{startTime}
	
	
            and DATE_FORMAT(check_date, '%Y-%m-%d') <= #{endTime}
